import React, { Fragment } from "react";
import "../Styles/seed.css";
import ChevronUpDouble from '../assets/chevron_up_double.svg';
import Close from '../assets/close.svg';
import Create from '../assets/create.svg';
import Diamond from '../assets/diamond.svg';
import Eye from '../assets/eye.svg';
import FingerPrint from '../assets/fingerprint.svg';
import Home from '../assets/home.svg';
import Link from '../assets/link.svg';
import MessageWriting from '../assets/message_writing.svg';
import PaperClip from '../assets/paperclip.svg';
import Picture from '../assets/picture.svg';
import Plus from '../assets/plus.svg';
import Rocket from '../assets/rocket.svg';
import Target from '../assets/target.svg';
import UserMaleCircle from '../assets/user_male_circle.svg';

export default function Icon(props) {
  const { className, icon, iconClassName } = props;

  return (
    <Fragment><div className={` ${className} h-pr-fl-ma r-h-c b-s-b-b `}></div>
      <img className={` ${iconClassName } w-100 h-100  p-r m-a r-v-c p-5px `} Style="object-fit: cover;" src={` ${icon} `}/>
    </Fragment>
  );
}
